function hookPrisma(pkg) {
  if (pkg.name === '@nest-http/prisma') {
    pkg.version = pkg.dependencies['@prisma/client'];
  }
  // if (pkg.name === 'nestjs-prisma') {
  //   pkg.peerDependencies['@prisma/client'] = '*';
  //   pkg.devDependencies['@prisma/client'] = undefined;
  // }
  // if (pkg.name === 'prisma-extension-pagination') {
  //   pkg.peerDependencies['@prisma/client'] = '*';
  // }
  return pkg;
}

module.exports = {
  hooks: {
    readPackage: hookPrisma,
  },
};

module.exports = {
  singleQuote: true,
  trailingComma: 'all',
  importOrder: ['^@(?!/).*$', '^@/(.*)$', 'shared', '^[./]'],
  importOrderSeparation: true,
  importOrderSortSpecifiers: true,
  importOrderParserPlugins: ['typescript', 'decorators-legacy', 'jsx'],
  plugins: [require('@trivago/prettier-plugin-sort-imports')],
};

module.exports = {
  apps: [
    {
      name: 'ChatGPT Admin Web',
      script: 'pnpm run start',
      instances: 1,
      autorestart: true,
      watch: false,
      max_memory_restart: '2G',
      env: {
        NODE_ENV: 'development',
      },
      env_production: {
        NODE_ENV: 'production',
      },
    },
  ],
};

{
  "name": "chatgpt-admin-web",
  "version": "3.2.4",
  "description": "ChatGPT Admin Web",
  "license": "MIT",
  "author": "AprilNEA <github@sku.moe> (https://sku.moe)",
  "repository": {
    "type": "git",
    "url": "git+https://github.com/AprilNEA/ChatGPT-Admin-Web"
  },
  "workspaces": [
    "apps/*",
    "packages/*",
    "prisma"
  ],
  "scripts": {
    "build": "turbo run build",
    "build:frontend": "turbo run build --filter frontend",
    "dev": "turbo run dev --parallel",
    "start": "turbo run start",
    "lint": "turbo run lint",
    "test": "vitest run",
    "prettier": "prettier --write .",
    "db:init": "prisma db push && prisma db seed",
    "db:generate": "prisma generate"
  },
  "devDependencies": {
    "@trivago/prettier-plugin-sort-imports": "latest",
    "@types/node": "latest",
    "prettier": "latest",
    "prisma": "5.6.0",
    "ts-node": "latest",
    "turbo": "latest",
    "typescript": "latest",
    "vite": "^5.0.7",
    "vite-tsconfig-paths": "^4.2.2",
    "vitest": "^1.0.2",
    "zod": "latest"
  },
  "prisma": {
    "schema": "prisma/schema.prisma",
    "seed": "ts-node prisma/seed.ts"
  },
  "engines": {
    "node": ">=18"
  },
  "pnpm": {
    "overrides": {
      "@liaoliaots/nestjs-redis>@nestjs/common": "^10.0.0",
      "@liaoliaots/nestjs-redis>@nestjs/core": "^10.0.0",
      "@liaoliaots/nestjs-redis>@nestjs/terminus": "^10.0.0"
    },
    "allowedDeprecatedVersions": {
      "sourcemap-codec": "1.4.8"
    }
  },
  "packageManager": "pnpm@8.6.3"
}

{
  "compilerOptions": {
    "module": "CommonJS",
    "declaration": true,
    "strictNullChecks": true,
    "removeComments": true,
    "emitDecoratorMetadata": true,
    "experimentalDecorators": true,
    "esModuleInterop": true,
    "allowSyntheticDefaultImports": true,
    "target": "es2021",
    "sourceMap": true,
    "outDir": "./dist",
    "baseUrl": ".",
    "noImplicitAny": false,
    "incremental": true,
    "resolveJsonModule": true,
    "skipLibCheck": true,
    "paths": {
      "frontend": [
        "./packages/frontend/src"
      ],
      "frontend/*": [
        "./packages/frontend/src/*"
      ],
      "backend": [
        "./packages/backend/src"
      ],
      "backend/*": [
        "./packages/backend/src/*"
      ],
      "shared": [
        "./packages/shared/src"
      ],
      "shared/*": [
        "./packages/shared/src/*"
      ],
      "@test": [
        "."
      ],
      "@test/*": [
        "./*"
      ],
      "@prisma/client": [
        "./prisma/client"
      ]
    }
  },
  "exclude": [
    "dist",
    "tmp"
  ]
}

import { resolve } from 'path';
import tsconfigPath from 'vite-tsconfig-paths';
import { defineConfig } from 'vitest/config';

export default defineConfig({
  root: './test',
  test: {
    include: ['**/*.spec.ts', '**/*.e2e-spec.ts'],

    globals: true,
    setupFiles: [resolve(__dirname, './test/setup-file.ts')],
    environment: 'node',
    includeSource: [resolve(__dirname, './test')],
  },

  plugins: [
    tsconfigPath({
      projects: [
        resolve(__dirname, './test/tsconfig.json'),
        resolve(__dirname, './tsconfig.json'),
      ],
    }),
  ],
});
